import React, { Component } from 'react';
import './App.css';
import Board from './Components/Board'
import Square from './Components/Square'

class App extends Component {

  createGame = () => {
    var board = []
    for(var i = 0; i < 9; i++){
        board.push(<Square value = {<Board key = {i} value = {i} />} size = {"Big"} key = {i + 100} />)
    }
    return board
  }

  render() {
    return (
      <div className="App">
        <h1>Ultimate Tic Tac Toe</h1>
        <div className="MainGame">
          {this.createGame()}
        </div>
      </div>
    );
  }
}

export default App;
